import React from 'react'
import { Link } from 'react-router-dom'

const Navbar = () => {
  return (
    <nav>
      <Link to='/' >Home</Link>{" "}
      <Link to='/login' >Log-In</Link>{" "}
      <Link to='/signup' >Sign-Up</Link>{" "}
      <Link to='/users' >Users</Link>{" "}
    </nav>
  )
}

export default Navbar
